import React from 'react';
import { Link } from 'react-router-dom';
import styled from 'styled-components';

const Card = styled.div`
  background: white;
  border-radius: 12px;
  overflow: hidden;
  box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
  transition: transform 0.2s, box-shadow 0.2s;
  cursor: pointer;

  &:hover {
    transform: translateY(-4px);
    box-shadow: 0 8px 20px rgba(0, 0, 0, 0.15);
  }
`;

const ImageContainer = styled.div`
  position: relative;
  height: 200px;
  overflow: hidden;
`;

const PropertyImage = styled.img`
  width: 100%;
  height: 100%;
  object-fit: cover;
`;

const Badge = styled.span`
  position: absolute;
  top: 1rem;
  left: 1rem;
  background: ${props => props.type === 'sale' ? '#10b981' : props.type === 'rent' ? '#3b82f6' : '#f59e0b'};
  color: white;
  padding: 0.25rem 0.75rem;
  border-radius: 20px;
  font-size: 0.8rem;
  font-weight: 500;
  text-transform: uppercase;
`;

const Content = styled.div`
  padding: 1.5rem;
`;

const Price = styled.div`
  font-size: 1.5rem;
  font-weight: 700;
  color: #3b82f6;
  margin-bottom: 0.5rem;
`;

const Title = styled.h3`
  font-size: 1.1rem;
  font-weight: 600;
  margin-bottom: 0.5rem;
  color: #1e293b;
`;

const Location = styled.p`
  color: #64748b;
  margin-bottom: 1rem;
  font-size: 0.9rem;
`;

const Features = styled.div`
  display: flex;
  gap: 1rem;
  margin-bottom: 1rem;
  font-size: 0.9rem;
  color: #374151;
  flex-wrap: wrap;
`;

const Feature = styled.span`
  display: flex;
  align-items: center;
  gap: 0.25rem;
`;

const DealTerms = styled.div`
  background: #f8fafc;
  padding: 0.75rem;
  border-radius: 6px;
  margin-bottom: 0.5rem;
  font-size: 0.85rem;
`;

const TermItem = styled.div`
  display: flex;
  justify-content: space-between;
  margin-bottom: 0.25rem;

  &:last-child {
    margin-bottom: 0;
  }
`;

const TermLabel = styled.span`
  color: #64748b;
`;

const TermValue = styled.span`
  color: #1e293b;
  font-weight: 500;
`;

const DealInfo = styled.div`
  display: flex;
  gap: 0.5rem;
  margin-bottom: 1rem;
  flex-wrap: wrap;
`;

const DealTag = styled.span`
  background: ${props => props.color || '#e5e7eb'};
  color: white;
  padding: 0.25rem 0.5rem;
  border-radius: 12px;
  font-size: 0.75rem;
  font-weight: 500;
  text-transform: capitalize;
`;

const CategoryTag = styled.span`
  background: #64748b;
  color: white;
  padding: 0.25rem 0.5rem;
  border-radius: 12px;
  font-size: 0.75rem;
  font-weight: 500;
`;

const DEAL_COLORS = {
  'seller-finance': '#10b981', // Green
  'hybrid': '#f59e0b',         // Orange  
  'subject-to': '#8b5cf6',     // Purple
  'cash': '#ef4444'            // Red
};

const PropertyCard = ({ property }) => {
  const formatDealType = (dealType) => {
    return dealType ? dealType.split('-').map(word => 
      word.charAt(0).toUpperCase() + word.slice(1)
    ).join(' ') : '';
  };

  return (
    <Link to={`/property/${property.id}`} style={{ textDecoration: 'none' }}>
      <Card>
        <ImageContainer>
          <PropertyImage 
            src={property.image} 
            alt={property.title}
            onError={(e) => {
              e.target.src = 'https://via.placeholder.com/400x200?text=Property+Image';
            }}
          />
          <Badge type={property.type}>{property.type}</Badge>
        </ImageContainer>
        <Content>
          <Price>
            ${property.price.toLocaleString()}
          </Price>
          <Title>{property.title}</Title>
          <Location>üìç {property.location}</Location>
          {(property.dealType || property.category) && (
            <DealInfo>
              {property.dealType && (
                <DealTag color={DEAL_COLORS[property.dealType]}>
                  {formatDealType(property.dealType)}
                </DealTag>
              )}
              {property.category && (
                <CategoryTag>
                  {property.category === 'multifamily' ? 'Multi-Family' : 'Single Family'}
                </CategoryTag>
              )}
            </DealInfo>
          )}
          <Features>
            {property.bedrooms && <Feature>üõèÔ∏è {property.bedrooms} bed</Feature>}
            {property.bathrooms && <Feature>üöø {property.bathrooms} bath</Feature>}
            {property.sqft && <Feature>üìê {property.sqft} sqft</Feature>}
            {property.units && property.units > 1 && <Feature>üè† {property.units} units</Feature>}
          </Features>

          {/* Deal-specific terms */}
          {property.dealType !== 'cash' && property.dealType && (
            <DealTerms>
              {(property.dealType === 'seller-finance' || property.dealType === 'hybrid') && (
                <>
                  {property.downPayment && (
                    <TermItem>
                      <TermLabel>Down Payment:</TermLabel>
                      <TermValue>${parseInt(property.downPayment).toLocaleString()}</TermValue>
                    </TermItem>
                  )}
                  {property.interestRate && (
                    <TermItem>
                      <TermLabel>Interest Rate:</TermLabel>
                      <TermValue>{property.interestRate}%</TermValue>
                    </TermItem>
                  )}
                  {property.monthlyPayment && (
                    <TermItem>
                      <TermLabel>Monthly Payment:</TermLabel>
                      <TermValue>${parseInt(property.monthlyPayment).toLocaleString()}</TermValue>
                    </TermItem>
                  )}
                </>
              )}
              {(property.dealType === 'subject-to' || property.dealType === 'hybrid') && (
                <>
                  {property.existingMortgageBalance && (
                    <TermItem>
                      <TermLabel>Existing Mortgage:</TermLabel>
                      <TermValue>${parseInt(property.existingMortgageBalance).toLocaleString()}</TermValue>
                    </TermItem>
                  )}
                  {property.monthlyMortgagePayment && (
                    <TermItem>
                      <TermLabel>Monthly Mortgage:</TermLabel>
                      <TermValue>${parseInt(property.monthlyMortgagePayment).toLocaleString()}</TermValue>
                    </TermItem>
                  )}
                </>
              )}
            </DealTerms>
          )}
        </Content>
      </Card>
    </Link>
  );
};

export default PropertyCard;
